          </script><script>function base64ToUint8Array(base64) {
	const binaryStr = atob(base64);
	const len = binaryStr.length;
	const bytes = new Uint8Array(len);
	for (let i = 0; i < len; i++) {
		bytes[i] = binaryStr.charCodeAt(i);
	}
	return bytes;
}

async function loadCompressedScript(base64CompressedBundle) {
	if (!base64CompressedBundle) {
		console.warn("No bundle provided");
		return;
	}

	try {
		const compressedData = base64ToUint8Array(base64CompressedBundle);
		const decompressedJS = pako.inflate(compressedData, { to: 'string' });

		const jsBlob = new Blob([decompressedJS], { type: 'application/javascript' });
		const jsBlobUrl = URL.createObjectURL(jsBlob);

		const script = document.createElement('script');
		script.src = jsBlobUrl;

		script.onload = () => {
			URL.revokeObjectURL(jsBlobUrl);
			console.log('Game scripts loaded successfully');
		};

		script.onerror = (e) => {
			console.error('Failed to load the scripst:', e);
			URL.revokeObjectURL(jsBlobUrl);
		};

		document.body.appendChild(script);
	} catch (error) {
		console.error("Failed to load compressed scripts:", error);
	}
}

window.addEventListener('load', () => {
	loadCompressedScript(window.__source_code);
});
